import React from "react"
import './symbols.css'
import './style.css'
import './Desktop.js'
import './desktop.css'

export default function Symbols(props) {
    return (
      <div id="each-icon">
        <div id="icons-pic"><img src={props.icon} alt="imp"></img></div>
        <p id="icon-name">{props.title}</p>
      </div>
    )
}
